// Search Options:--
// Keyword search
// posted date search (date search)
// response date search (date search)
// place of performance state search option (multiple checkboxes)
// place of performance zipcode search (comma saparated zipcode)
// Naics code search (multiple checkbox - this is also separted search)
// PSC code search (multiple checkbox - this is also separted search)
// Federal set-aside code search (multiple checkbox - this is also separted search)
// Agency and Subagency Search (multiple search  - this is also separted search)
import React, {useState} from 'react';

const SolicitationSearchBar = () => {
    const [status, setStatus] = useState(true);
    var myval;
    if(status===true){
      myval = false;
    }else{
      myval = true;
    }
    return (
        <>
            
            <div className="centerform">
                <div className="solicitation">
                    <h3>Solicitation Search</h3>

                    <div style={{ width: '100%', minHeight: '76px' }}>
                        <div style={{ float: 'left', width: '50%' }}>
                            <input className="myinputclass" type="text" value="" placeholder="First Name" name="f_name" />
                        </div>
                        <div style={{ float: 'right', width: '50%' }}>
                            <input className="myinputclass" style={{ marginLeft: "15px" }} type="text" value="" placeholder="Last Name" name="l_name" />
                        </div>
                    </div>
                    <div style={{ width: '100%', minHeight: '76px' }}>
                        <div style={{ float: 'left', width: '50%' }}>
                            <input className="myinputclass" type="text" value="" placeholder="Email Address" name="email" />
                        </div>
                        <div style={{ float: 'right', width: '50%' }}>
                            <input className="myinputclass" style={{ marginLeft: "15px" }} type="text" value="" placeholder="Phone" name="phone" />
                        </div>
                    </div>
                    <div style={{ width: '100%', minHeight: '76px' }}>
                        <select style={{ width: '95%' }} className="myinputclass" name="usertype" value="">
                            <option value="">
                                Please Select User Type
                            </option>
                            <option value="Super Admin">
                                Super Admin
                            </option>
                            <option value="Admin">
                                Admin
                            </option>
                            <option value="Staff">
                                Staff
                            </option>
                            <option value="Account">
                                Account
                            </option>
                        </select>
                    </div>

                    <div style={{ width: '100%', minHeight: '76px' }}>
                        <div style={{ float: 'left', width: '50%' }}>
                            <input className="myinputclass" type="text" value="" placeholder="Password" autoComplete="on" name="password" />
                        </div>
                        <div style={{ float: 'right', width: '50%' }}>
                            <input className="myinputclass" style={{ marginLeft: "15px" }} type="text" autoComplete="on" value="" placeholder="Confirm Password" name="confPassword" />
                        </div>
                    </div>
                    
                </div>
            </div>
        </>
    )
}

export default SolicitationSearchBar;
